// App.js
import React from 'react';
import './App.css';
import Navbar from './components/Navbar/Navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Shop from './pages/Shop';
import Cart from './pages/Cart';
import LoginSignup from './pages/LoginSignup';
import ShopCategory from './pages/ShopCategory';
import bird from './components/assets/bird.webp'; // Example import
import dog from './components/assets/dog.webp'; // Example import
import cat from './components/assets/cat.webp'; // Example import
import ShopContextProvider from './context/ShopContextProvider';

function App() {
  return (
    <ShopContextProvider>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path='/' element={<Shop />} />
          <Route path='/dog' element={<ShopCategory banner={dog} category="dog" />} />
          <Route path='/cat' element={<ShopCategory banner={cat} category="cat" />} />
          <Route path='/bird' element={<ShopCategory banner={bird} category="bird" />} />
          <Route path='/cart' element={<Cart />} />
          <Route path='/login' element={<LoginSignup />} />
        </Routes>
      </BrowserRouter>
    </ShopContextProvider>
  );
}

export default App;
